    data: |
      SELECT DISTINCT + col0 + + col2 / + CAST ( NULL AS INTEGER ) * col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col2 BETWEEN - 20 AND - - col1;
  - name: tab1

outputs:
  - name: q5597.out
    data: |
